  false,\n\t\"url\": null,\n\t\"notes\": \"From 1995 through 2010, the two canneries
  in American Samoa provided Cannery Offloading Reports to the Department of Marine
  and Wildlife Resources (DMWR) office. In 1998, WPacFIN assisted DMWR in developing
  a data entry system to capture and compile these data, which were entered and processed
  at the DMWR office. These data consist of the vessel names, dates of offloading,
  and weights of the major species offloaded for all vessels at the canneries. During
  the first few years of the federally mandated longline logbook reporting, data on
  the amount of domestic longline vessel landings at the canneries were used by DMWR
  to assist WPacFIN in verifying and monitoring delinquencies in reporting via federal
  longline logbooks. More recently, changes in the American Samoa Government and in
  the management of the canneries have affected the continuity of cannery reporting
  to the DMWR. Cannery reporting started to fall behind in 2008, and no reports have
  been submitted to the DMWR since 2010. There is an ongoing effort by the DMWR to
  revive this data collection. These data are considered highly confidential.\",\n\t\"owner_org\":
